import React from 'react'
import './answer.css'

const Answer= (props) => {
  let step= Object.keys(props.step)
  let aswer= Object.keys(props.answer).map((qAnswer, i)=>{
    <li key={qAnswer}>
      {props.answer[qAnswer]}
    </li>

  });
  return(
    <ul className="Answers">
    {aswer}{step}
    </ul>
  );


}

export default Answer;
